var z340median = 2.694e-07;
var z408median = 2.140e-07;

var fragIocZ340Mean = 9.221e-07;
var fragIocZ340Sigma = 1.812715e-07;

var fragIocZ408Mean = 8.043e-07;
var fragIocZ408Sigma = 1.230456e-07;

function Cipher(name, ciphertext, fragments, fragmentsScore1, fragmentsScore2, fragmentIoc) {
	//name: Name/description of cipher
	this.name = name;
	//ciphertext: Cipher text in symbolic form
	this.ciphertext = ciphertext;
	//fragments: array of Fragment
	this.fragments = fragments;
	//fragmentsScore1: repeating fragment score, including normal bigrams
	this.fragmentsScore1 = fragmentsScore1;
	//fragmentsScore2: repeating fragment score, excluding normal bigrams
	this.fragmentsScore2 = fragmentsScore2;
	//fragment ioc
	this.fragmentIoc = fragmentIoc;
	//highlightAll(): highlight all fragments in the cipher
	this.highlightAll = function () {
		alert("high");
	}
	//clearAll(): clear all fragments in the cipher
	this.clearAll = function () {
		alert("clear");
	}
	// return the fragment with the given key
	this.fragment = function (key) {
		for (var i=0; i<fragments.length; i++)
			if (fragments[i].ngram == key) {
				fragments[i].index = i;
				return fragments[i];
			}
		return null;
	}
	// render buttons for highlighting fragments
	this.buttons = function() {
		var html = "Select a pattern to view it: <br/>";
		for (var i=0; i<fragments.length; i++) {
			html += fragments[i].button() + " ";
		}
		html += "<button onmouseover='allOn()' onmouseout='allOff()'>[ HIGHLIGHT ALL ]</button>";
		return html;
	}
	// number of repeats
	this.repeats = function() {
		var reps = 0;
		for (var i=0; i<fragments.length; i++) {
			reps += (fragments[i].positions.length-1);
		}
		return reps;
	}
	// total count of patterns
	this.total = function() {
		var reps = 0;
		for (var i=0; i<fragments.length; i++) {
			reps += (fragments[i].positions.length);
		}
		return reps;
	}
	// mean probability
	this.meanProb = function() {
		var sum = 0;
		for (var i=0; i<fragments.length; i++) {
			sum += fragments[i].probability;
		}
		return (sum/fragments.length).toExponential(4);
	}
	// coverage (number of positions that are involved in repeated patterns)
	this.coverage = function() {
		var set = {};
		for (var i=0; i<fragments.length; i++) {
			var frag = fragments[i];
			for (var j=0; j<frag.positions.length; j++) {
				for (var k=0; k<frag.ngram.length; k++) {
					var pos = frag.positions[j]+k;
					var c = frag.ngram.charAt(k);
					if (c == ' ' || c == '?') continue;
					set[pos] = true;
				}
			}
			
		}
		var count = 0;
		for (var key in set) count++;
		return (100*count/ciphertext.length).toPrecision(4);
	}
	// coverage (number of positions that are involved in repeated patterns), considering only the better patterns below the median
	this.coverageBelowMedian = function() {
		var set = {};
		for (var i=0; i<fragments.length; i++) {
			var frag = fragments[i];
			for (var j=0; j<frag.positions.length; j++) {
				for (var k=0; k<frag.ngram.length; k++) {
					var pos = frag.positions[j]+k;
					var c = frag.ngram.charAt(k);
					if (c == ' ' || c == '?') continue;
					if (ciphersNew[which].is340() && frag.probability > z340median) continue;
					if (ciphersNew[which].is408() && frag.probability > z408median) continue;
					set[pos] = true;
				}
			}
			
		}
		var count = 0;
		for (var key in set) count++;
		return (100*count/ciphertext.length).toPrecision(4);
	}
	
	// sigma from mean of fragment ioc for random shuffles
	this.sigma = function() {
		var result = "";
		var which;
		if (this.ciphertext.length == 340) {
			result += ((this.fragmentIoc - fragIocZ340Mean) / fragIocZ340Sigma).toPrecision(4);
			which = "Z340";
		} else if (this.ciphertext.length == 408) {
			result += ((this.fragmentIoc - fragIocZ408Mean) / fragIocZ408Sigma).toPrecision(4);
			which = "Z408";			
		} else result += "N/A";
		result += "<i><b>&sigma;</b></i> from mean of 1,000,000 shuffles of " + which;
		return result;
	}
	this.is340 = function () {
		return this.ciphertext.length == 340;
	}
	this.is408 = function () {
		return this.ciphertext.length == 408;
	}
	
}

function Fragment(ngram, probability, count, positions) {
	//ngram: the ngram pattern that repeats
	this.ngram = ngram;
	//probability: its probability
	this.probability = probability;
	//count: number of occurrences
	this.count = count;
	//positions: array of start positions for each occurrence
	this.positions = positions;
	//highlight(): mark the fragments in the cipher
	this.highlight = function() {
		for (var i=0; i<this.positions.length; i++) {
			for (var j=0; j<ngram.length; j++) {
				var pos = this.positions[i]+j;
				var c = ngram.charAt(j);
				if (c == ' ' || c == '?') continue;
				on(pos);
			}
		}
	}
	//clear(): unmark the fragments in the cipher
	this.clear = function() {
		for (var i=0; i<this.positions.length; i++) {
			for (var j=0; j<ngram.length; j++) {
				var pos = this.positions[i]+j;
				var c = ngram.charAt(j);
				if (c == ' ' || c == '?') continue;
				off(pos);
			}
		}
	}
	//button(): render button
	this.button = function() {
		var html = "<button class=\"";
		var style="";
		if (ciphersNew[which].ciphertext.length == 340) {
			if (this.probability > z340median) style="cutoff";
		}
		else if (ciphersNew[which].ciphertext.length == 408) {
			if (this.probability > z408median) style="cutoff";
		}
		html += style + "\" onmouseover='fragOver(\"" + encode2(ngram) + "\")' onmouseout='fragOut(\"" + encode2(ngram) + "\")'>" + encode(ngram) + "</button>";
		return html;
	}
}

function encode(str) {
	return str.replace("<", "&lt;");
}
function encode2(str) {
	return str.replace("\\", "\\\\");
}
function fragOver(ngram) {
	ciphersNew[which].fragment(ngram).highlight();
	showProb(ngram);
}
function fragOut(ngram) {
	ciphersNew[which].fragment(ngram).clear();
	clearProb();
}

function allOn() {
	for (var i=0; i<ciphersNew[which].fragments.length; i++) {
		ciphersNew[which].fragments[i].highlight();
	}
}
function allOff() {
	for (var i=0; i<ciphersNew[which].fragments.length; i++) {
		ciphersNew[which].fragments[i].clear();
	}
}

function renderFragments() {
	render();
	document.getElementById("results").innerHTML = ciphersNew[which].buttons();
	renderFragmentsStats();
}

function renderFragmentsStats() {
	var html = "";
	var c = ciphersNew[which];
	var best = c.fragments[0];
	html += "<b>Number of fragment patterns:</b>  " + c.fragments.length + "<br/>";
	html += "<b>Number of repeats (all patterns):</b>  " + c.repeats() + "<br/>";
	html += "<b>Total count (all patterns):</b>  " + c.total() + "<br/>";
	html += "<b>Most improbable fragment:</b>  <tt>" +  encode(best.ngram) + "</tt> <i>(relative probability: " + best.probability.toPrecision(4) + ")</i><br/>";
	html += "<b>Mean relative probability:</b>  " + c.meanProb() + "<br/>";
	if (c.is340()) 
		html += "<b>Median relative probability for fragments from 1m shuffles of Z340: </b>" + z340median.toExponential(4) + "<br/>";
	if (c.is408()) 
		html += "<b>Median relative probability for fragments from 1m shuffles of Z408: </b>" + z408median.toExponential(4) + "<br/>";
	html += "<b>Percentage of cipher text covered by repeating patterns:</b>  " + c.coverage() + "%<br/>";
	html += "<b>Percentage of cipher text covered by repeating patterns below median:</b>  " + c.coverageBelowMedian() + "%<br/>";
	html += "<b>Fragment IoC:</b>  " + c.fragmentIoc.toExponential(4) + " (" + c.sigma() + ")<br/>";
	document.getElementById("fragmentStats").innerHTML = html;
}

function showProb(ngram) {
	var frag = ciphersNew[which].fragment(ngram);
	var html = "<b>Index:</b> " + (frag.index+1) + "<br/><b>Selected fragment:</b> " + encode(frag.ngram) + "<br/>";
	html += "<b>Count:</b> " + frag.count + "<br/>";
	html += "<b>Relative probability:</b> " + frag.probability.toPrecision(4);
	document.getElementById("prob").innerHTML = html;
}
function clearProb() {
	document.getElementById("prob").innerHTML = "";
}

function renderChoices() {
	var html = "Select a cipher: <select id='choicesSelect' onchange='selectedCipher()'>";
	for (var i=0; i<ciphersNew.length; i++) {
		html += "<option>" + ciphersNew[i].name + "</option>";
	}
	html += "</select>";
	document.getElementById("choices").innerHTML = html;
	
}

function selectedCipher() {
	which = document.getElementById("choicesSelect").selectedIndex;
	renderFragments();
}

